(, 'День космонавтики', 'АО «Марка» совместно с Московским отделением Союза художников России провели Открытый всероссийский тематический конкурс рисунка для почтовой марки и художественного маркированного конверта по теме «С Днём космонавтики!».\r\n\r\nЦелями и задачами конкурса являются привлечение внимания ко Дню космонавтики; продвижение идеи «мирного космоса»; популяризация жанра авторской художественной миниатюры, выполненной как в традиционных «ручных» техниках, так и с помощью цифровых технологий; привлечение новых авторов к жанру почтовой миниатюры.\r\n\r\nНа почтовой марке изображена работа победителя конкурса И. Мирошниченко — образ космонавта на фоне космического пространства.', 1);
INSERT INTO `Stamp` (`Image`, `name`, `descr`, `id`) VALUES
(, 'Серия «Флора России. Первоцветные»', 'Первоцветные — преимущественно многолетние травянистые растения разнообразного облика. Появляются ранней весной, иногда ещё до того, как полностью сойдёт снег, в разных климатических зонах этот период может растягиваться на несколько месяцев. Значительная часть первоцветных на территории России представлена в горных и арктических районах.\r\n\r\nВ России произрастают первоцветы Юлии, весенний и дудчатый, разные виды проломников, очный цвет полевой, вербейник обыкновенный, кортуза сибирская, млечник приморский.\r\n\r\nНа почтовых марках изображены первоцвет Юлии, вербейник обыкновенный, очный цвет полевой и кортуза сибирская.', 2);
